import{_ as o,o as e,c,e as d}from"./app.6bf529a6.js";const t={},a=d('<h1 id="\u53C8\u89E3\u51B3\u4E00\u4E2Aallgit\u7684\u95EE\u9898" tabindex="-1"><a class="header-anchor" href="#\u53C8\u89E3\u51B3\u4E00\u4E2Aallgit\u7684\u95EE\u9898" aria-hidden="true">#</a> \u53C8\u89E3\u51B3\u4E00\u4E2Aallgit\u7684\u95EE\u9898</h1><blockquote><p>\u8BF4\u4E00\u4EF6\u50BB\u903C\u75AF\u4E86\u7684\u4E8B\u60C5.</p></blockquote><hr><p>\u6628\u5929 ( 19 \u5E74 8 \u6708 8 \u65E5 ), \u6211\u5F00\u59CB\u8BD5\u7740\u7528 gitbook \u8FDB\u884C\u6587\u6863\u7684\u5199\u4F5C.</p><p>\u4E3A\u4E86\u65B9\u4FBF\u6587\u4EF6\u7684\u540C\u6B65, \u6211\u628A gitbook \u7684\u76EE\u5F55\u653E\u5230\u4E86\u5DE5\u4F5C\u6587\u6863\u7684\u76EE\u5F55\u4E0B ( <code>~/gitpath/document</code> ). \u8FD9\u4E2A\u6587\u6863\u5728\u516C\u53F8\u7ED9\u7684\u670D\u52A1\u5668\u4E0A\u6709\u4E00\u4E2A git \u5E93, \u901A\u8FC7 <code>allgit</code> \u811A\u672C\u8FDB\u884C\u81EA\u52A8\u5316\u540C\u6B65.</p><p>\u4E0D\u77E5\u9053\u662F\u4EC0\u4E48\u539F\u56E0, ( \u6211\u731C, \u53EF\u80FD\u662F\u56E0\u4E3A\u6211\u5728\u6267\u884C <code>allgit</code> \u7684\u65F6\u5019, \u6B63\u5728\u8DD1 <code>gitbook serve</code> ) \u5BFC\u81F3 git \u5230\u4E2D\u9014\u7A81\u7136\u4E2D\u65AD, \u7136\u540E\u83AB\u660E\u5176\u5999\u7684\u5C31\u51FA\u73B0\u5728\u4E00\u5806 <code>root</code> \u6743\u9650\u7684\u6587\u4EF6 ( \u5927\u6982\u662F\u56E0\u4E3A, \u6211\u5728\u6267\u884C <code>gitbook serve</code> \u65F6\u5E26\u4E86 <code>sudo</code> ).</p><p>\u4E8E\u662F\u4E00\u6012\u4E4B\u4E0B, \u628A <code>.zshrc</code> \u4E2D <code>allgit</code> \u7684\u522B\u540D\u91CC, \u5E26\u4E86 <code>sudo</code>. \u7ED3\u679C\u6240\u6709\u7684 git \u5E93\u7684\u514D\u5BC6\u7801\u529F\u80FD\u90FD\u4E0D\u80FD\u7528\u4E86.</p><p>\u6211\u67E5\u4E86\u5404\u79CD\u6587\u6863, \u60F3\u4E86\u5404\u79CD\u529E\u6CD5. \u751A\u81F3\u91CD\u65B0\u751F\u6210\u4E86 <code>ssh</code> \u7684\u516C\u94A5, \u7ED3\u679C\u6839\u672C\u9E1F\u7528\u6CA1\u6709.</p><p>\u751A\u81F3 <code>github</code> \u7684\u4EE3\u7801\u5E93\u90FD\u63D0\u4EA4\u4E0D\u4E86, \u9519\u8BEF\u63D0\u793A\u662F <code>\u6743\u9650\u4E0D\u591F</code>.</p><p>\u7ED3\u679C\u4ECA\u5929\u65E9\u4E0A, \u60F3\u5230, \u662F\u4E0D\u662F\u56E0\u4E3A\u5728\u522B\u540D\u4E0A\u5E26\u4E86 <code>sudo</code> \u7684\u539F\u6545: \u6309\u7406\u8BF4, \u4E00\u65E6\u5E26\u4E0A <code>sudo</code> \u5C31\u662F\u5728\u7528 <code>root</code> \u7684 <code>ssh</code> \u516C\u94A5.</p><p>\u4E8E\u662F, \u628A\u522B\u540D\u91CC\u7684 <code>sudo</code> \u53BB\u6389, \u679C\u7136, \u4E00\u5207\u6B63\u5E38\u4E86.</p>',11),i=[a];function l(s,r){return e(),c("div",null,i)}var p=o(t,[["render",l],["__file","\u53C8\u89E3\u51B3\u4E00\u4E2Aallgit\u7684\u95EE\u9898.html.vue"]]);export{p as default};
